using Amazon.CDK.AWS.ServiceDiscovery;
using Amazon.CDK.AWS.Apigatewayv2.Integrations.Alpha;


Vpc vpc = new Vpc(this, "VPC");
VpcLink vpcLink = new VpcLink(this, "VpcLink", new VpcLinkProps { Vpc = vpc });
PrivateDnsNamespace namespace = new PrivateDnsNamespace(this, "Namespace", new PrivateDnsNamespaceProps {
    Name = "boobar.com",
    Vpc = vpc
});
Service service = namespace.CreateService("Service");

HttpApi httpEndpoint = new HttpApi(this, "HttpProxyPrivateApi", new HttpApiProps {
    DefaultIntegration = new HttpServiceDiscoveryIntegration("DefaultIntegration", service, new HttpServiceDiscoveryIntegrationProps {
        VpcLink = vpcLink
    })
});

java.source:
import software.amazon.awscdk.services.servicediscovery.*;
import software.amazon.awscdk.services.apigatewayv2.integrations.alpha.HttpServiceDiscoveryIntegration;


Vpc vpc = new Vpc(this, "VPC");
VpcLink vpcLink = VpcLink.Builder.create(this, "VpcLink").vpc(vpc).build();
PrivateDnsNamespace namespace = PrivateDnsNamespace.Builder.create(this, "Namespace")
        .name("boobar.com")
        .vpc(vpc)
        .build();
Service service = namespace.createService("Service");

HttpApi httpEndpoint = HttpApi.Builder.create(this, "HttpProxyPrivateApi")
        .defaultIntegration(HttpServiceDiscoveryIntegration.Builder.create("DefaultIntegration", service)
                .vpcLink(vpcLink)
                .build())
        .build();

